import { Card, Grid } from 'semantic-ui-react';
import DoctorCard from '../components/DoctorCard';
import Axios from 'axios';

import React, { Component } from 'react';

export default class SearchIndex extends Component {
  loadSearchIndex = async () => {
    const {searchId} = this.props.match.searchId
    const index = [];
    let csv = '';
    try {
      let res = await Axios.get(`http://localhost:3000/searches/${searchId}`);
      csv = res.data.csv;
    } catch (err) {}
    csv = csv.split(',');
    csv.pop();
    console.log(csv, 'CSV FROM LOADSEARCHINDEX');
    await csv.forEach(async (id) => {
      console.log(id);
      let doctorId = parseInt(id);
      let res = await Axios.get(`http://localhost:3000/doctors/${doctorId}`);
      let doc = res.data;
      console.log(doc);
      index.push(doc);
    });
    console.log(index);
    await this.props.setSearchIndex(index);
  };

  displayDoctors = () => {

    return searchIndex.map((doc) => <div key={doc.id}>{doc.name}</div>);
  };

  componentDidMount() {
    this.loadSearchIndex();

  }
  render() {
    console.log(this.props)
    return <div></div>;
  }
}
